import React from 'react';
import './structure.scss';


const Accordion = ({ title, children }) => {
    const [isOpen, setOpen] = React.useState(false);

    return (
      <div className="accordion-wrapper">
        <div
          className={`accordion-title ${isOpen ? "open" : ""}`}
          onClick={() => setOpen(!isOpen)}
          >
          {title}
        </div>
        <div className={`accordion-item ${!isOpen ? "collapsed" : ""}`}>
          <div className="accordion-content">{children}</div>
        </div>
      </div>
    );
  };


const Structure = () => {
    return (
         <div className="structure">
             <h2>Struktur</h2>
             <div className="wrapper">
                <Accordion title="Sturuktur 2">
                    <ul>
                        <li>Hüquq</li>
                        <li>Marketinq</li>
                        <li>İnvestisiya</li>
                    </ul>
                </Accordion>

                <Accordion title="Sturuktur 3">
                    <ul>
                        <li>Hüquq</li>
                        <li>Marketinq</li>
                        <li>İnvestisiya</li>
                    </ul>
                </Accordion>

                <Accordion title="Sturuktur 4">
                    <ul>
                        <li>Hüquq</li>
                        <li>Marketinq</li>
                        <li>İnvestisiya
                        <Accordion title="Sturuktur 4">

                            <ul>
                                <li>Starateji</li>
                                <li>Starateji</li>
                                <li>Starateji</li>
                            </ul>
                            </Accordion>

                        </li>
                    </ul>
                </Accordion>
            </div>
         </div>
    );
};


export default Structure;
